class CustomMarkerRenderingStrategy<ActualMarker>( semaphore: Semaphore = Semaphore(1), geocell: HexGeocell = HexGeocellImpl.defaultGeocell()
) : AbstractViewportStrategy<ActualMarker>(semaphore, geocell) { override suspend fun onCameraChanged( cameraPosition: MapCameraPositionImpl, renderer: MarkerOverlayRenderer<ActualMarker> ) { semaphore.withPermit { // Custom rendering logic val visibleBounds = cameraPosition.visibleRegion?.bounds ?: return // Your custom marker management here val markersToShow = determineVisibleMarkers(visibleBounds) val markersToHide = determineHiddenMarkers(visibleBounds) // Use renderer to update display if (markersToHide.isNotEmpty()) { renderer.onRemove(markersToHide) } if (markersToShow.isNotEmpty()) { val addParams = markersToShow.map { entity -> object : MarkerOverlayRenderer.AddParams { override val state: MarkerState = entity.state override val bitmapIcon: BitmapIcon = entity.state.icon?.toBitmapIcon() ?: defaultIcon } } renderer.onAdd(addParams) } renderer.onPostProcess() } } private fun determineVisibleMarkers(bounds: GeoRectBounds): List<MarkerEntity<ActualMarker>> { // Your custom logic to determine which markers should be visible return markerManager.findMarkersInBounds(bounds) } private fun determineHiddenMarkers(bounds: GeoRectBounds): List<MarkerEntity<ActualMarker>> { // Your custom logic to determine which markers should be hidden return markerManager.allEntities().filter { entity -> entity.isRendered && !bounds.contains(entity.state.position) } }
}

