data class MarkerCluster( val center: GeoPoint, val markers: List<MarkerState>, val radius: Double
) : java.io.Serializable @Composable
fun MarkerClusteringExample() { var zoomLevel by remember { mutableStateOf(10f) } val allMarkers = remember { List(200) { i -> MarkerState( position = GeoPointImpl.fromLatLong( 37.7749 + (Random.nextFloat() - 0.5f) * 0.1, -122.4194 + (Random.nextFloat() - 0.5f) * 0.1 ), extra = "Marker $i" ) } } val displayedItems = remember(zoomLevel) { if (zoomLevel > 13) { // Show individual markers at high zoom allMarkers.map { Either.Left(it) } } else { // Cluster at low zoom clusterMarkers(allMarkers, 1000.0 / zoomLevel).map { Either.Right(it) } } } Column { Slider( value = zoomLevel, onValueChange = { zoomLevel = it }, valueRange = 8f..16f, modifier = Modifier.padding(16.dp) ) Text("Zoom: ${zoomLevel.toInt()}") // Replace MapView with your chosen map provider, such as GoogleMapsView, MapboxMapView
MapView(state = mapViewState) { displayedItems.forEach { item -> when (item) { is Either.Left -> { // Individual marker Marker(item.value) } is Either.Right -> { // Cluster val cluster = item.value Marker( position = cluster.center, icon = DefaultIcon( fillColor = Color.Red, label = cluster.markers.size.toString(), scale = 1.2f ), extra = "Cluster of ${cluster.markers.size} markers" ) } } } } }
} sealed class Either<out L, out R> : java.io.Serializable { data class Left<out L>(val value: L) : Either<L, Nothing>() data class Right<out R>(val value: R) : Either<Nothing, R>()
} fun clusterMarkers(markers: List<MarkerState>, clusterRadius: Double): List<MarkerCluster> { val clusters = mutableListOf<MarkerCluster>() val unclustered = markers.toMutableList() while (unclustered.isNotEmpty()) { val seed = unclustered.removeFirst() val clusterMembers = mutableListOf(seed) val iterator = unclustered.iterator() while (iterator.hasNext()) { val marker = iterator.next() if (calculateDistance(seed.position, marker.position) <= clusterRadius) { clusterMembers.add(marker) iterator.remove() } } val center = calculateCentroid(clusterMembers.map { it.position }) clusters.add(MarkerCluster(center, clusterMembers, clusterRadius)) } return clusters
} fun calculateCentroid(points: List<GeoPoint>): GeoPoint { val avgLat = points.map { it.latitude }.average() val avgLng = points.map { it.longitude }.average() return GeoPointImpl.fromLatLong(avgLat, avgLng)
}

