fun GeofencingExample() { var userPosition by remember { mutableStateOf(GeoPointImpl.fromLatLong(37.7749, -122.4194)) } var alerts by remember { mutableStateOf<List<String>>(emptyList()) } val geofences = listOf( Triple( GeoPointImpl.fromLatLong(37.7800, -122.4100), 300.0, "Downtown Zone" ), Triple( GeoPointImpl.fromLatLong(37.7700, -122.4300), 200.0, "Restricted Area" ) ) // Check geofence violations LaunchedEffect(userPosition) { val newAlerts = mutableListOf<String>() geofences.forEach { (center, radius, name) -> val distance = calculateDistance(userPosition, center) if (distance <= radius) { newAlerts.add("Entered: $name") } } alerts = newAlerts } Column { if (alerts.isNotEmpty()) { Card( backgroundColor = Color.Yellow.copy(alpha = 0.3f), modifier = Modifier.padding(8.dp) ) { Column(modifier = Modifier.padding(16.dp)) { Text("Geofence Alerts:") alerts.forEach { alert -> Text("• $alert") } } } } // Replace MapView with your chosen map provider, such as GoogleMapsView, MapboxMapView
MapView( state = mapViewState, onMapClick = { geoPoint -> userPosition = geoPoint } ) { // Draw geofences geofences.forEach { (center, radius, name) -> Circle( center = center, radius = radius, strokeColor = Color.Red, strokeWidth = 2.dp, fillColor = Color.Red.copy(alpha = 0.1f), extra = name ) Marker( position = center, icon = DefaultIcon( fillColor = Color.Red, label = name.first().toString(), scale = 0.8f ) ) } // User position Marker( position = userPosition, icon = DefaultIcon( fillColor = Color.Blue, label = "👤", scale = 1.2f ), draggable = true ) } }
}

